        return 0
    else:
        idx = 0
        for i in range(n):
            if s[idx] == i + 1:
                if idx < m - 1:
                    idx += 1
                else:
                    break
        if i == n - 1:
            return int(''.join(list(map(str, c))))
        else:
            return int(''.join(list(map(str, c))) + '0' * (n - i - 1))

