def dfs(s_c_dict, n, i, num):
    if i == n:
        return []
    elif i + 1 in s_c_dict:
        for c in s_c_dict[i + 1]:
            if c > num:
                return [c] + dfs(s_c_dict, n, i + 1, c)
        return [-1]
    else:
        if num == 9:
            return [-1]
        else:
            return [num + 1] + dfs(s_c_dict, n, i + 1, num + 1)


